         $('.form1').on('submit', function (e) {
     
                e.preventDefault();

                let name=$(this).find('#name').val();
                let phone=$(this).find('#number').val();
                let email=$(this).find('#email').val();
                let message=$(this).find('#message').val();
                let serviceprice=$(this).find('.serviceprice').val();
                let servicename=$(this).find('.servicename').val();
                // let servicetitle=$('.servicetitle').val();
                let pagename=$(this).find('.pagename').val();
                
                var StartDate=$(this).find('.StartDate').val();
                var NDA = $(this).find('.NDA:checked').siblings('label').text();
                
                
                let source= ``;
                let campaign= ``;
                let dat=`/role-of-an-ecommerce-experts`;
               
               
            
               // return false;
              $.ajax({
                  url:`https://algosecom.com/ajaxForm`,
                  method:"post",
                  data:{name:name,phone:phone,email:email,message:message,serviceprice:serviceprice,servicename:servicename,pagename:pagename,source:source,campaign:campaign,dat:dat,StartDate:StartDate,NDA:NDA},
                  headers: {'X-CSRF-Token': $('meta[name="csrf-token"]').attr('content')},
                  dataType:"json",
                  success:function(data){
                      if(data){
                         $('#singupmodal .btn-close').trigger("click");
                         $(this).find('input').val('');
                         $('#message').text('');
                          toastr.success(data.msg)
                          window.location.href = "thank-you/";
                      }else{
                          toastr.error(data.msg)
                      }
                  }
              })
           })
           
        
        
